// returns true if the class c1 is a decendent of class c2
// note: if c1 == c2, then psiInstanceOf will return true
function psiInstanceOf(c1, c2){
	var mySet = new Set();
	return psiInstanceOfAux(c1, c2, mySet);
}

// auxiliary function for psiInstanceOf
function psiInstanceOfAux(c1, c2, visited){

	// console.log(c1 + " | " + c2);

	if(c1 in visited){
		return false;
	}
	visited.add(c1);

	if(c1 === c2){
		return true;
	}


	if(classTable[c1]["type"] === "interface"){

		var i;
		for(i = 0; i < classTable[c1]["extends"].length; i++){
			// console.log("\t" + classTable[c1]["extends"][i]);
			if(psiInstanceOfAux(classTable[c1]["extends"][i], c2, visited)){
				return true;
			}
		}

	}else if(classTable[c1]["type"] === "class"){

		if(classTable[c1].hasOwnProperty("extends") && psiInstanceOfAux(classTable[c1]["extends"], c2, visited)){
			return true;
		}


		var i;
		for(i = 0; i < classTable[c1]["implements"].length; i++){
			if(psiInstanceOfAux(classTable[c1]["implements"][i], c2, visited)){
				return true;
			}
		}

	}

	return false;

}